CREATE TABLE SGDTEST.COR_CORRESPONDENCIA
(
    IDE_DOCUMENTO NUMBER(18) PRIMARY KEY NOT NULL,
    DESCRIPCION VARCHAR2(500) DEFAULT NULL 
,
    TIEMPO_RESPUESTA VARCHAR2(8) DEFAULT NULL 
,
    COD_UNIDAD_TIEMPO VARCHAR2(8) DEFAULT NULL 
,
    COD_MEDIO_RECEPCION VARCHAR2(8) DEFAULT NULL 
,
    FEC_RADICADO TIMESTAMP(6) NOT NULL,
    NRO_RADICADO VARCHAR2(50) NOT NULL,
    COD_TIPO_CMC VARCHAR2(8) DEFAULT NULL 
,
    IDE_INSTANCIA VARCHAR2(50) DEFAULT NULL 
,
    REQ_DIST_FISICA VARCHAR2(2) DEFAULT NULL 
,
    COD_FUNC_RADICA VARCHAR2(8) DEFAULT NULL 
,
    COD_SEDE VARCHAR2(32) DEFAULT NULL 
,
    COD_DEPENDENCIA VARCHAR2(32 char) DEFAULT NULL 
,
    REQ_DIGITA VARCHAR2(2) DEFAULT NULL 
,
    COD_EMP_MSJ VARCHAR2(8) DEFAULT NULL 
,
    NRO_GUIA VARCHAR2(50) DEFAULT NULL 
,
    FEC_VEN_GESTION TIMESTAMP(6) DEFAULT NULL 
,
    COD_ESTADO VARCHAR2(8) DEFAULT NULL 
,
    COD_CLASE_ENVIO VARCHAR2(8) DEFAULT NULL,
    COD_MODALIDAD_ENVIO VARCHAR2(8) DEFAULT NULL
);
